      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

// Import this file to use console.log
import "hardhat/console.sol";
import "./Interfaces/IMintableOracle.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./Interfaces/IERC1155Sale.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";
error MintLimitWillBeExceeded();
error NotEnoughBNBPassed();
contract NeoCortexAIMintEngine is Ownable,ReentrancyGuard{
    uint256 public flatFee = 3100000000000000;
    mapping(address => uint256) public amountMinted;
    address payable public  feeCollector ;
    IERC1155Sale public NFT;
    IMintableOracle public Oracle;
    constructor (IERC1155Sale _nft,IMintableOracle _oracle ,address payable _feeCollector,address _owner){
        NFT = _nft;
        feeCollector =_feeCollector;
        Oracle = _oracle;
        transferOwnership(_owner);
    }

    function mint(address to,uint256 id)external payable nonReentrant{
        uint256 maxMintable = Oracle.getMaxMintable(to);
        if(amountMinted[to] >= maxMintable){
            revert MintLimitWillBeExceeded();
        }
        if(feeCollector != address(0)){
            if(msg.value < flatFee){
                revert NotEnoughBNBPassed();
            }
            feeCollector.transfer(msg.value);
        }
        
        NFT.mint(to, id, 1, "");
        amountMinted[to] +=1;
        
    }
    function mintBatch(address to, uint256[] memory ids, uint256[] memory amounts) external payable nonReentrant{
        uint256 maxMintable = Oracle.getMaxMintable(to);
        uint256 toMint=0;
        for(uint256 i =0; i < ids.length;i++){
            toMint +=amounts[i];
        }
        if(toMint + amountMinted[to] > maxMintable){
            revert MintLimitWillBeExceeded();
        }
        if(feeCollector != address(0)){
            if(msg.value < flatFee *toMint){
                revert NotEnoughBNBPassed();
            }
            feeCollector.transfer(msg.value);
        }       
        NFT.mintBatch(to, ids, amounts, "");
        amountMinted[to] +=toMint;
    }
    function setflatFee(uint256 _flatFee)external onlyOwner{
        flatFee = _flatFee;
    }
    function setFeeCollector(address payable _feeCollector)external onlyOwner{
        feeCollector =_feeCollector;
    }
    function setNft(IERC1155Sale _nft) external onlyOwner{
        NFT = _nft;
    }
    function setOracle(IMintableOracle _oracle ) external onlyOwner{
        Oracle = _oracle;
    }   
}"
